import React from 'react';
import Link from 'next/link';
import {
  Heading, Box,
  Alert, AlertIcon, AlertTitle, AlertDescription
} from '@chakra-ui/core';

function Landing() {
  return (
    <Box p={10} bg="tomato">
      <Heading>Welcome to Adonis Next JS</Heading>
      <Link href="/about-us">
        <a>About Us</a>
      </Link>
    </Box>
  )
}

export default Landing
